import React, { Component } from "react";
const styles = {
  paperContainer: {
    height: 1356,
    backgroundImage: `url(${"./Images/bg.jpg"})`,
  },
};
class Background extends Component {
  render() {
    return <div style={styles.paperContainer}></div>;
  }
}

export default Background;
